package com.yunshang.haile_life.data.entitiesimport android.text.TextUtilsclass AliPayResultEntity(rawResult: Map<String, String>) {    /**     * @return the resultStatus     */    var resultStatus: String? = null    /**     * @return the result     */    var result: String? = null    /**     * @return the memo     */    var memo: String? = null    init {        for (key in rawResult.keys) {            if (TextUtils.equals(key, "resultStatus")) {                resultStatus = rawResult[key]            } else if (TextUtils.equals(key, "result")) {                result = rawResult[key]            } else if (TextUtils.equals(key, "memo")) {                memo = rawResult[key]            }        }    }    override fun toString(): String {        return ("resultStatus={" + resultStatus + "};memo={" + memo                + "};result={" + result + "}")    }}